import React from "react";
import Translate from "../../Translate";
import {Button} from "reactstrap";

export default function MyButton(props) {

    return (
            <Button
                outline={props.outline}
                color={props.type}
                onClick={props.onClick}
            >
                <Translate name={props.name}/>
            </Button>
        )
}
